 void Akey(int fd,  struct uinput_user_dev uidev){
	 int dtime=200000; //in ms
	 //A hold D*3 L K J* 2 K L relese A

    // Simulate pressing and releasing the 'A' key
    struct input_event event;
    memset(&event, 0, sizeof(event));

    event.type = EV_KEY;
    event.code = KEY_A;
    event.value = 1;  // Pressing the key
    write(fd, &event, sizeof(event));

    event.type = EV_SYN;
    event.code = SYN_REPORT;
    event.value = 0;
    write(fd, &event, sizeof(event));
/////////////D1///////////////////////
    event.type = EV_KEY;
    event.code = KEY_D;
    event.value = 1;  // Pressing the key
    write(fd, &event, sizeof(event));

    event.type = EV_SYN;
    event.code = SYN_REPORT;
    event.value = 0;
    write(fd, &event, sizeof(event));
    usleep(dtime/2);
        event.type = EV_KEY;
    event.code = KEY_D;
    event.value = 0;  // Releasing the key
    write(fd, &event, sizeof(event));

    event.type = EV_SYN;
    event.code = SYN_REPORT;
    event.value = 0;
    write(fd, &event, sizeof(event));
      usleep(dtime/2);
    ///////////D1////////////////
    /////////////D2///////////////////////
    event.type = EV_KEY;
    event.code = KEY_D;
    event.value = 1;  // Pressing the key
    write(fd, &event, sizeof(event));

    event.type = EV_SYN;
